script: |
  super -f text -I q4262.spq | sort > q4262.out

inputs:
  - name: q4262.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col1 NOT IN ( + - col1 * col0 - - - col1, col1 + + col2, col1, - 56, - + col1 * col2 );
  - name: tab1

outputs:
  - name: q4262.out
    data: |
      51	14	96
      85	5	59
      91	47	68
